$(document).ready(function(){$("button[data-type=preview]").click(function(){var e=$(this).parents("form");return postJson(e.attr("action")+"?preview=true",e.serialize(),function(e){200==e.code?Dialog.box({title:"预览",content:'<pre><code class="language-php">'+Prism.highlight(e.data.code,Prism.languages.php)+"</code></pre>"}):parseAjax(e)}),!1})});